import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SalaryTable.css';

const SalaryTable = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);

  useEffect(() => {
    const fetchSalaries = async () => {
      try {
        console.log(`Fetching salaries for contractId: ${contractId}, month: ${month}, year: ${year}`);
        const response = await axios.get(`http://localhost:5000/api/contracts/${contractId}/salaries?month=${month}&year=${year}`);
        console.log('Fetched salaries:', response.data);
        setSalaries(response.data);
      } catch (error) {
        console.error('Error fetching salaries:', error);
      }
    };

    fetchSalaries();
  }, [contractId, month, year]);

  return (
    <div className="salary-table">
      <h2>Salary Details</h2>
      <table>
        <thead>
          <tr>
            <th>Employee Name</th>
            <th>Attendance</th>
            <th>Daily Wage</th>
            <th>Gross Salary</th>
            <th>Employee EPF</th>
            <th>Employee ESIC</th>
            <th>P Tax</th>
            <th>Total Deductions</th>
            <th>Net Salary</th>
            <th>Employer EPF</th>
            <th>Employer ESIC</th>
            <th>Admin Charges</th>
            <th>Contribution</th>
          </tr>
        </thead>
        <tbody>
          {salaries.map((salary) => (
            <tr key={salary._id}>
              <td>{salary.employeeId ? salary.employeeId.name : 'Unknown'}</td>
              <td>{salary.attendance}</td>
              <td>{salary.dailyWage}</td>
              <td>{salary.grossSalary.toFixed(2)}</td>
              <td>{salary.employeeEPF.toFixed(2)}</td>
              <td>{salary.employeeESIC.toFixed(2)}</td>
              <td>{salary.pTax.toFixed(2)}</td>
              <td>{salary.totalDeductions.toFixed(2)}</td>
              <td>{salary.netSalary.toFixed(2)}</td>
              <td>{salary.employerEPF.toFixed(2)}</td>
              <td>{salary.employerESIC.toFixed(2)}</td>
              <td>{salary.adminCharges.toFixed(2)}</td>
              <td>{salary.contribution.toFixed(2)}</td>
            </tr>
          ))}
          <tr>
            <td>Totals</td>
            <td>-</td>
            <td>-</td>
            <td>{salaries.reduce((sum, record) => sum + record.grossSalary, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.employeeEPF, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.employeeESIC, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.pTax, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.totalDeductions, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.netSalary, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.employerEPF, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.employerESIC, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.adminCharges, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, record) => sum + record.contribution, 0).toFixed(2)}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default SalaryTable;
